tables.table_schema:
CREATE TABLE public_health_campaigns (
  campaign_id INT PRIMARY KEY,
  campaign_name TEXT,
  start_date DATE,
  end_date DATE
);

CREATE TABLE demographic_data (
  data_id INT PRIMARY KEY,
  demographic_group TEXT,
  age_group TEXT,
  gender TEXT
);

CREATE TABLE campaign_impact (
  impact_id INT PRIMARY KEY,
  campaign_id INT,
  data_id INT,
  impact_score FLOAT
);

CREATE TABLE public_health_campaigns (
    campaign_id INT PRIMARY KEY,
    campaign_name VARCHAR(100) NOT NULL,
    start_date DATE,
    end_date DATE
);

CREATE TABLE campaign_performance (
    id INT PRIMARY KEY,
    campaign_id INT NOT NULL,
    city VARCHAR(50) NOT NULL,
    performance_score FLOAT NOT NULL
);

CREATE TABLE campaign_engagement (
    id INT PRIMARY KEY,
    campaign_id INT NOT NULL,
    city VARCHAR(50) NOT NULL,
    engagement_level VARCHAR(20)
);

CREATE TABLE campaign_demographics (
    campaign_id INT,
    demographic_id INT
);
